from base64 import b64decode as base64_b64decode
from io import BytesIO
from PIL import Image, ImageQt
from PyQt5.QtGui import QPixmap, QIcon as QtGui_QIcon


class IconClass:
    def __init__(self):
        self._Addexplode: str = b''
        self._ArrowLeft2explode: str = b''
        self._ArrowRight2explode: str = b''
        self._Deleteexplode: str = b''
        self._Downloadexplode: str = b''
        self._Earthexplode: str = b''
        self._Exitexplode: str = b''
        self._Loadexplode: str = b''
        self._logoexplode: str = b''
        self._Resultexplode: str = b''
        self._Saveexplode: str = b''
        self._Startexplode: str = b''
        self._Thermalexplode: str = b''
        self._Updateexplode: str = b''
        self._Boreholeexplode: str = b''

        self.Adder = self.DecodeIcon(self._Addexplode)
        self.ArrowLeft2 = self.DecodeIcon(self._ArrowLeft2explode)
        self.ArrowRight2 = self.DecodeIcon(self._ArrowRight2explode)
        self.Delete = self.DecodeIcon(self._Deleteexplode)
        self.Download = self.DecodeIcon(self._Downloadexplode)
        self.Earth = self.DecodeIcon(self._Earthexplode)
        self.Exit = self.DecodeIcon(self._Exitexplode)
        self.Load = self.DecodeIcon(self._Loadexplode)
        self.logo = self.DecodeIcon(self._logoexplode)
        self.Save = self.DecodeIcon(self._Saveexplode)
        self.Start = self.DecodeIcon(self._Startexplode)
        self.Thermal = self.DecodeIcon(self._Thermalexplode)
        self.Update = self.DecodeIcon(self._Updateexplode)
        self.Result = self.DecodeIcon(self._Resultexplode)
        self.Borehole = self.DecodeIcon(self._Boreholeexplode)

    @staticmethod
    def DecodeIcon(string: str) -> QtGui_QIcon:
        """
        Compile a b64decoded string to an icon

        Parameters
        ----------
        string : str
            String to be compiled

        Returns
        -------
        Icon : QIcon
            Icon of compiled string

        Examples
        --------
        DecodeIcon(b'AAABAAcAEBAAAAAAIAC')

        """
        byte_data = base64_b64decode(string)
        image_data = BytesIO(byte_data)
        image = Image.open(image_data)
        qImage = ImageQt.ImageQt(image)
        image = QPixmap.fromImage(qImage)
        Icon: QtGui_QIcon = QtGui_QIcon(image)
        return Icon
